import React, { Component } from "react";

class Videos extends Component {
  render() {
    const size = {
      height: "200px",
      width: "200px"
    };
    return (
      <div className="videos">
        <div className="videos__next">NEXT VIDEO</div>
        <div className="videos__thumbnail">
          <img src={this.props.image} style={size} />
        </div>
        <div className="videos__details">
          <h4 className="videos__details--title">{this.props.title}</h4>
          <h4 className="video__details--channel">{this.props.channel}</h4>
        </div>
      </div>
    );
  }
}

export default Videos;
